local REQUIRED_LIBS = {
		["VPrediction"] = "https://github.com/Hellsing/BoL/blob/master/common/VPrediction.lua",
		["Prodiction"] = "https://bitbucket.org/Klokje/public-klokjes-bol-scripts/raw/master/Common/Prodiction.lua",
